import React, { useEffect, useState } from 'react';

const Doggie = () => {
    const url = "https://api.thedogapi.com/v1/images/search?limit=16";
    const [dogs, setDogs] = useState([]);

    useEffect(() => {
        fetch(url)
            .then(response => response.json())
            .then(data => {
                setDogs(data);
            });
    }, []);
    return (
        <>
            <div>
                <h2>Dogs:</h2>
                <div className="grid-container">
                    {dogs.map(dog => (
                        <div key={dog.id}>
                            <img src={dog.url} alt={dog.breeds[0].name} />
                            <div>
                                <h3>{dog.breeds[0].name}</h3>
                                <p>Lifetime: {dog.breeds[0].life_span}</p>
                                <p>Food: {dog.breeds[0].food}</p>
                            </div>
                        </div>
                    ))}
                </div>
            </div>

        </>
    );
}

export default Doggie;
